import "../styles/dashboard.css";

const Dashboard = () => {
  return (
    <>
      <GridContainer>
        <Menu style={{ gridColumn: "1 / 5", gridRow: "1 / 2" }} />
        {/* <Navbar
          style={{
            marginTop: "40px",
            gridColumn: "5 / 25",
            gridRow: "1 / 5",
          }}
          titlePage="DASHBAORD"
        />
        <ContainerDashboardCard
          style={{ gridColumn: "10 / 25", gridRow: "5 / 25" }}
        /> */}
      </GridContainer>
    </>
  );
};
export default Dashboard;
